class List extends React.Component{
    constructor(props){
        super(props);
        this.state={ rests : [] };

        fetch('http://localhost:4000/rests/')
            .then(response =>{
                response.json();
            })
            .then(rests => {
                this.setState({rests})
            })
            .then( (err) => {
                console.log(err);
            })
    }
    render(){
        return(
            <div>
                <ul>
                    {this.state.rests.map( post => 
                    <p>
                        <li>Some Text_1: {post.RestaurantName}</li>
                        <li>Some Text_2: {post.RestaurantName}</li>
                        <li>Some Text_3: {post.RestaurantName}</li>
                    </p>
                    )}
                </ul>
            </div>
        )
    }
}
export default List;
